export default testFileTree = {
  name: 'test',
  children: [
    {
      name: 'assets',
      children: [
        {
          name: 'fonts',
          children: [{ name: 'helvetica.otf' }],
        },
        {
          name: 'images',
          children: [{ name: 'logo.png' }, { name: 'avatar.jpg' }],
        },
      ],
    },
    {
      name: 'index.js',
    },
  ],
};
